node.text:
“Dove te ne vai? Lo sai che mi ferisce la smania di rincorrere il tempo per vivere un attimo in più di questa vita.”
@levanteofficial 
#levante #iononsonoaria #frasindie #indieitalia

“Perché spesso a Natale mi viene il magone, con le luci, il presepe e tutte quelle persone.”
@brunorisas 
#brunorisas #iononsonoaria #frasindie #indieitalia

“Dentro questa stanza che ha l'aria sfatta quasi quanto me mi addormento guardando le previsioni del tempo, ed è già passato un altro inverno.”
@federicabbateof 
#federicaabbate #iononsonoaria #frasindie #indieitalia

“Quando sei qui con me, questa stanza non ha più pareti.”
@amodente 
#dente #iononsonoaria #frasindie #indieitalia

“Sento glaciali i tuoi occhi verdi su di me, mentre raccolgo le mie cose e ti bacio sulla fronte.”
@iosonoercole 
#ercole #iononsonoaria #frasindie #indieitalia

“Occhi diversi tutte le sere ma sempre il solito vecchio sorriso.”
@pinguini_tattici_nucleari 
#pinguinitatticinucleari #iononsonoaria #frasindie #indieitalia

“Non siamo dei santi, dai, sbagliamo anche noi e a volte è anche bello trattarsi un po’ male, dormire di schiena per poi farsi abbracciare.”
@brunorisas 
#brunorisas #iononsonoaria #frasindie #indieitalia

“E le tue smagliature le userò come trincee per fuggire dai nazisti e un po' da me.”
@la_municipal 
#lamunicipal #iononsonoaria #frasindie #indieitalia

“E hai chiuso da poco con chi non t'ha capita e forse non ti capirà mai.”
@treallegri 
#treallegriragazzimorti #iononsonoaria #frasindie #indieitalia

“Siamo diversi ma siamo gli stessi.”
@fulminacci 
#fulminacci #iononsonoaria #frasindie #indieitalia

“Ho letto due libri che parlan di guerra, non dicono niente, me la fai già tu.”
@generic_animal (e ci sarebbe anche @franchino126 )
#genericanimal #franco126 #iononsonoaria #frasindie #indieitalia

“E ho il cellulare scarico ma no che non lo spengo, vorrei che fossi qui e invece sei qua dentro, quello che è rimasto è soltanto un sentimento che si sta affievolendo.”
@_io_suono_con_i_ganci_ 
#ganci #iononsonoaria #frasindie #indieitalia

“E per me ogni tua piccola lacrima sarà come fiume in piena.”
@rovereband 
#rovere #iononsonoaria #frasindie #indieitalia

“Amore mio, da dove vengo io un bacio ed un addio sono la stessa cosa.”
@pinguini_tattici_nucleari 
#pinguinitatticinucleari #iononsonoaria #frasindie #indieitalia

“L'acqua scende gelida, asciugo questa voglia che ho di te.”
@_aiello__ 
#aiello #iononsonoaria #frasindie #indieitalia

“Una vita così non vale, il tempo é fuggito ed é sempre latitante.”
@exotago 
#exotago #iononsonoaria #frasindie #indieitalia

“E non sai più cosa pensare perché lo stato ti ha tolto pure la ragione.”
@lecanzonidimaltese 
#maltese #iononsonoaria #frasindie #indieitalia

“Ci scioglieremo al sole di questo stupido weekend anche se oggi piove ed è soltanto lunedì.”
@imieimiglioricomplimenti 
#imieimiglioricomplimenti #iononsonoaria #frasindie #indieitalia

“Mi hai fatto volare troppo vicino al sole e anche se non uccide comunque fa un poʼ male.”
@wrongonyou 
#wrongonyou #iononsonoaria #frasindie #indieitalia

“Allo specchio non mi riconosco, ma alla fine dico tutto a posto.”
@canova 
#canova #iononsonoaria #frasindie #indieitalia

“Tu mi guardi con quegli occhi che non sanno niente, io ho il cuore infreddolito adesso chi lo scalderà?”
@cadmiofficial 
#cadmio #iononsonoaria #frasindie #indieitalia

“Un'altra nottata buttata a pensare al tuo nome.”
@ibotaniciband 
#ibotanici #iononsonoaria #frasindie #indieitalia

“E sto solo questa sera, che mi sopporto a malapena.”
@franchino126 
#franco126 #iononsonoaria #frasindie #indieitalia
